html, body { font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen-Sans, Ubuntu, Cantarell, "Fira Sans", "Droid Sans", "Helvetica Neue", Helvetica, "ヒラギノ角ゴ Pro W3", "Hiragino Kaku Gothic Pro", メイリオ, Meiryo, "ＭＳ Ｐゴシック", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; color: rgb(33, 25, 34); font-size: 12px; height: 100%; }
body { position: relative; overflow: hidden scroll; }
a { color: rgb(113, 113, 113); font-weight: bold; text-decoration: none; }
a:focus, a:hover { color: rgb(138, 138, 138); }
ul { margin: 0px; padding: 0px; }
ul li { list-style: outside none none; padding: 0px; }
:focus { outline: rgb(209, 209, 209) auto 1px; }
button, input, select, textarea { font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen-Sans, Ubuntu, Cantarell, "Fira Sans", "Droid Sans", "Helvetica Neue", Helvetica, "ヒラギノ角ゴ Pro W3", "Hiragino Kaku Gothic Pro", メイリオ, Meiryo, "ＭＳ Ｐゴシック", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol"; font-size: 100%; vertical-align: middle; margin: 0px; }
.SkipToContent { display: none; }
@keyframes scrollBgGridLinks {
0% { transform: translateY(0px); }
100% { transform: translateY(-300px); }
}
@keyframes easeInScrollBanner {
0% { opacity: 0; transform: translateY(56px); }
100% { opacity: 1; transform: translateY(0px); }
}
.featuredScrollBannerAnimated { animation-delay: 250ms; animation-duration: 0.25s; animation-fill-mode: both; animation-name: easeInScrollBanner; animation-timing-function: ease-in-out; }
article, aside, details, figcaption, figure, footer, header, hgroup, nav, section, ul { display: block; }
audio, canvas, video { display: inline-block; }
audio:not([controls]) { display: none; }
html { font-size: 100%; }
a:hover, a:active { outline: currentcolor none 0px; }
sub, sup { position: relative; font-size: 75%; line-height: 0; vertical-align: baseline; }
sup { top: -0.5em; }
sub { bottom: -0.25em; }
img { max-width: 100%; width: auto; height: auto; vertical-align: middle; border: 0px none; }
#map_canvas img { max-width: none; }
fieldset { border: 0px none; margin: 0px; padding: 0px; }
button, input, select, textarea { font-size: 100%; margin: 0px; vertical-align: middle; }
button, input { overflow: visible; line-height: normal; }
button::-moz-focus-inner, input::-moz-focus-inner { padding: 0px; border: 0px none; }
button, input[type="button"], input[type="reset"], input[type="submit"] { cursor: pointer; -moz-appearance: button; }
input[type="search"] { box-sizing: content-box; -moz-appearance: textfield; }
input[type="search"]::-webkit-search-decoration, input[type="search"]::-webkit-search-cancel-button { -moz-appearance: none; }
textarea { overflow: auto; vertical-align: top; }
body { margin: 0px; }
h1, h2, h3, h4, h5, h6 { margin: 0px; }
figure { margin: 0px; }
.AlternativesSeparatorContinuous::before, .AlternativesSeparatorContinuous::after { background: rgba(0, 0, 0, 0.2) none repeat scroll 0% 0%; box-shadow: rgba(255, 255, 255, 0.5) 0px 1px 0px; content: ""; display: inline-block; height: 1px; position: relative; vertical-align: middle; width: 37%; }
