.Gender__customGenderTooltip::before { border-color: rgba(145, 145, 145, 0) rgba(145, 145, 145, 0) rgb(145, 145, 145); border-width: 11px; margin-left: -11px; }
.Gender__customGenderTooltipMobile::after, .customGenderTooltip::before { bottom: 100%; left: 92.5%; border: medium solid transparent; content: " "; height: 0px; width: 0px; position: absolute; pointer-events: none; }
.Gender__customGenderTooltipMobile::after { border-color: rgba(255, 255, 255, 0); border-width: 10px; margin-left: -10px; }
.Gender__customGenderTooltipMobile::before { border-color: rgba(145, 145, 145, 0) rgba(145, 145, 145, 0) rgb(145, 145, 145); border-width: 11px; margin-left: -11px; }
