.Gender__customGenderTooltipText::after { border-color: rgba(255, 255, 255, 0); border-width: 10px; margin-left: 5px; margin-top: 10px; }
.Gender__customGenderTooltipText::before { border-color: rgba(145, 145, 145, 0) rgba(145, 145, 145, 0) rgb(145, 145, 145); border-width: 11px; margin-left: 5px; margin-top: 10px; }
